import React from 'react';

function Rating({ question, options = [], onAnswer }) {
  return (
    <div className="rating">
      <p>{question}</p>
      {options.length > 0 ? (
        options.map((option, index) => (
          <button key={index} onClick={() => onAnswer(option)}>
            {option}
          </button>
        ))
      ) : (
        <p>No options available</p>
      )}
    </div>
  );
}

export default Rating;
